DELIMITER ;;
CREATE DEFINER=`0xc`@`localhost` PROCEDURE `clearData`(dateInt int(11))
begin

	declare endDate int;
	set endDate = dateInt;
	

	
	delete from blast_bets where kjTime < endDate and lotteryNo <> '';
	
	delete from blast_coin_log where actionTime < endDate;
	
	delete from blast_admin_log where actionTime < endDate;
	
	delete from blast_member_session where accessTime < endDate;
	
	delete from blast_member_cash where actionTime < endDate and state <> 1;
	
	delete from blast_member_recharge where actionTime < endDate and state <> 0;
	delete from blast_member_recharge where actionTime < endDate-24*3600 and state = 0;
	
	delete from blast_data where time < endDate;
		
	
end
;;
DELIMITER ;

