-- ----------------------------
--  Trigger definition for `blast_member_recharge`
-- ----------------------------
DELIMITER ;;
CREATE TRIGGER `trig_recharge_update` AFTER UPDATE ON `blast_member_recharge` FOR EACH ROW BEGIN
IF OLD.state = 1 OR OLD.state = 9 THEN
     IF OLD.flag = 0   THEN
          if NEW.amount>0 AND NEW.isDelete = 0 AND NEW.flag = 1 THEN
               
			   call setRechargeBack(NEW.amount, NEW.uid, NEW.id, NEW.rechargeId);
         end if;
     END IF;
END IF;
END
;;
DELIMITER ;
